import React, { useState } from "react";

function list() {
  const [title, setTitle] = useState("");

  const handleInputChange = (event) => {
    setTitle(event.target.value);
  };
  return (
    <div>
      <h2>Todo list</h2>
      <input type="text" value={title} onChange={handleInputChange} />
      <button>Add Todo List</button>
    </div>
  );
}

export default list;
